        MODULE OperationModule
            CONST robtarget PortalHighPoint:=[[-13.583341243,746.066869797,1014.459993125],[0.013993802,-0.570055065,0.820624094,0.037649604],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];
            CONST robtarget PortalEntry:=[[-434.055731075,387.84090848,937.564082687],[0.00129595,0.766122039,-0.642494033,-0.016023701],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];
            CONST robtarget PortalHoverPoint:=[[-631.245040038,556.972820959,570.118199049],[0.00217368,0.825005825,-0.56505388,-0.008647398],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];
            CONST robtarget HoverPointinwobjPalette:=[[135.37,228.21,-234.18],[0.814711508,0.002312507,0.003108067,-0.57985356],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];

            VAR intnum xpos:=%%x;
            VAR intnum ypos:=%%y;
            VAR intnum zpos:=%%z;

            PROC Operation()
                !*******************************
                ! Ablage (oder Aufnahme) des GV12 auf (von) der Palette.
                !*******************************
                MoveL PortalHighPoint,vFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
                MoveL PortalEntry,vFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
                MoveL PortalHoverPoint,vFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
                MoveL HoverPointinwobjPalette,vFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;

                MoveL Offs(HoverPointinwobjPalette,xpos,ypos,zpos-80),vMedium,fine,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;
                MoveL Offs(HoverPointinwobjPalette,xpos,ypos,zpos),vSlow,fine,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;
                %%gGripper;
                MoveL Offs(HoverPointinwobjPalette,xpos,ypos,zpos-80),vSlow,fine,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;

                MoveL HoverPointinwobjPalette,vMedium,z50,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;
                MoveL PortalHoverPoint,vMedium,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
                MoveL PortalEntry,vFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
                MoveL PortalHighPoint,vFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
            ENDPROC
        ENDMODULE
  time:timestamp: '2021-11-04T16:32:49.027+01:00'
